import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav, Button, Container } from "react-bootstrap";

export const NavigatiBar = ({ isAuthenticated, onLogout }) => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="px-3">
      <Container>
        {/* FOODGRAM Logo */}
        <Navbar.Brand as={Link} to="/" className="fw-bold text-warning">
          FOODGRAM
        </Navbar.Brand>

        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          {/* Navigation Links */}
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/create-recipe">Create Recipe</Nav.Link>
            <Nav.Link as={Link} to="/saved-recipes">Saved Recipes</Nav.Link>
          </Nav>

          {/* Align Logout Button to Right */}
          {isAuthenticated && (
            <Button variant="danger" className="ms-auto btn-logout" onClick={onLogout}>
              Logout
            </Button>
          )}
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
